data.text:
@TimoRepo Hi, I have no information at the moment regarding the SAS lounge in Helsinki unfortunately. Stay updated via our social media, website or press room for any news: https://t.co/RL3DxnfqaC
Or via Star Alliance Lounge finder at: https://t.co/pDTmqkbxai
Best Regards / Sanna

@P4faarlund Hi, I recommend that you call us, or chat with us in our live chat so that we can look at how we can help you in the best possible way.
You can find our phone numbers and our live chat here: https://t.co/b3QIqPk7bj
Best regards / Sanna

@sidseph Hi, I am sorry to hear the luggage was delayed. If no report was made on the airport, please make one here: https://t.co/uHX1YFCLU3
or call the airport: https://t.co/ZV9bTO3uo2 If you have a report, you can track it here: https://t.co/2zwsPbhQFU 
Kind regards, Rebecka

@TV2_Jon Hej, det har jag tyvärr ingen mer information om i dagsläget. Men ni kan hålla er uppdaterade på vår hemsida https://t.co/uHgETi2pF7 under "Changes to our Services" och "SAS Lounges". Den senaste informationen finns där.

Med vänlig hälsning,
Anton.

@mstandage Hello, please contact us on Facebook Messenger or livechat https://t.co/b3QIqPk7bj with your booking reference and we can help you take a look at this.

Best regards,
Anton.

@Esben181 Hello, I'm sorry to hear that your baggage is still delayed. For more information about your delayed baggage case I recommend you to try and contact baggage service support directly, phone numbers are available at https://t.co/ZV9bTNLSZs

Best regards,
Anton.

@chmarkuss1 Hej, SAS lounge är fortfarande stängd tillsvidare i Bergen, Trondheim och Helsinki. Vi har för närvarande ingen mer information om när de planeras att öppna igen dessvärre.

Med vänlig hälsning,
Anton.

@wilklasu Hej! Förlängning av 2-för-1 kuponger vid inställt/schemaändrat flyg hanteras manuellt och kan dröja något längre än återbetalning av poäng. Du kan kontakta oss på FB messenger eller livechatt https://t.co/z4gOZAAJQJ så kollar vi på det.

Med vänlig hälsning,
Anton.

@conormcd90 Hi and sorry for the late response, SK4604 DUB - OSL today is indeed cancelled. If you have not received a new alternative departure please contact customer service for assistance https://t.co/b3QIqPk7bj

Best regards,
Anton.

@IDreamInSQL Hello, generally you can use the bag drop 2-3 hours before planned departure, other arrangements may be possible depending on the airport's procedures.

Best regards,
Anton.

@derekmonroe16 Hello! This information is available on our website SAS Group https://t.co/iBiPP8x98k

Best regards,
Anton.

@Crypth Hi! For more information about the entry restrictions for your destination please check https://t.co/YhT9mVc7De - Select departure country, destination, citizenship and nationality and you will see a list with the entry rules and required documents for you.

Best regards,
Anton.

@Rickz206 Hi! 

Yes if you have not already requested a refund then i recommend that you contact our live-chat or call us via phone so we can help you. https://t.co/O6Jy9vqnvM

//Best regards. Dennis.

@user_283 Hi! 

Customer care sadly do have a long queue right now, but they will respond to you as soon as possible. The best we can recommend is to wait a bit more.

//Best regards, Dennis.

@Ulantinho1 Hi! 

I'm sorry you feel that way. Some flights are sadly cancelled and or changed due to pandemic prevention control measures and the unavailability of ground service at Shanghai Pudong International Airport.

//Best regards, Dennis.

@Gisela_ Hi! 

Yes it depends a little on where you are flying from, but if you switch airlines then you will need to check in again in Amsterdam.

//Best regards, Dennis.

@MattPerchick Hi! 

We sadly can't add a pet to the US in the hold right now. So the best we can recommend is to check with cargo companies if they can help. 

//Best regards, Dennis.

@Rickz206 Hi! 

I'm sorry that your flight was affected. If you would like to submit your complaints, please contact our Customer Care department.
You can contact them via this link:
https://t.co/OzrIxYNv63 and select "General Complaint or compliment".

//Best regards, Dennis.

@martin_jenco Hi, we don't have direct flights between PRG-ARN in June and July unfortunately, but if you are able to travel with a connection in FRA/ZRH/MUC there are tickets available with SAS and Lufthansa on code-share.

Best regards,
Anton.

@m96fa_91 Hi, unfortunately we are not able to assist with individual cases here over Twitter. Please contact our live-chat or phone support with your case ID and we can help you take a look at this https://t.co/b3QIqPk7bj

Best regards,
Anton.

@ENordlund Hello, our customer service is working as quickly as possible to take all calls. If you still need help, please call us again and your call will be taken as soon as possible.

Best regards,
Anton.

@AlexStypula Hello, we are unfortunately not able to help you book tickets over Twitter. Please contact our customer service again and they can help you take a look at availability and fare prices https://t.co/b3QIqPk7bj

Best regards,
Anton.

@UnicornPoet Hi, for help with looking at availability to Iceland please contact our sales and service support on the phone. You can find our phone numbers at https://t.co/b3QIqPk7bj

Best regards,
Anton.

@ArtistGillian Hi, I'm sorry to hear that your baggage is missing. Please contact Baggage service for more information about your backpack https://t.co/ZV9bTO3uo2 - Or if you have the PIR tracking number you can use Worldtracer https://t.co/2zwsPbhQFU

Best regards,
Anton.

@ParB32301814 Hej, Vi beklagar verkligen att ni känner så. Om ni önskar att lämna in feedback till oss går det att göra via vårt feedbackformulär på: https://t.co/Kh0HWq1mmg
Ni hittar alla våra kontaktuppgifter samt öppetider via vår hemsida: https://t.co/b3QIqPk7bj 
Vänliga hälsningar / Sanna

@keithtighe93 Hi, I recommend that you call us, or chat with us in our live chat or via Facebook messenger so that we can look at how we can help you in the best possible way.
You can find our phone numbers and our live chat here: https://t.co/b3QIqPk7bj
Best regards / Sanna

@yellowsunstar Hi, I recommend that you call us, or chat with us in our live chat or via Facebook messenger so that we can look at how we can help you in the best possible way.
You can find our phone numbers and our live chat here at: https://t.co/b3QIqPk7bj
Best regards / Sanna

@kamalendu_bis Hello!
You are welcome to call our ticket office and we will help you complete the booking. You will find our contact information here:https://t.co/b3QIqPk7bj

Kind regards, Anja!

@MichaelGreve11 Hello!
At the moment, there are many customers who want to contact us, which leads to increased queues. Please wait in the call and an agent will receive your call as soon as possible.

Thanks for contacting us, kind regards Anja!

@blackapinay Hello!
SAS travel voucher can be used for booking trips and extra services via SAS website. 

Thanks for contacting us, kind regards Anja!

@holidiaries Hello!
You can bring a stroller/pram as checked baggage in addition to the baggage included in the ticket, free of charge. This also applies to SAS Go Light tickets.

Kind regards, Anja!

@MacBerggren Hello! If you are not using the outbound trip, unfortunatly the return trip will be unusable. If you are planning not to use the outbound trip, please contact us and we can help you to cancel the outbound. Our Contact is found here: https://t.co/b3QIqPk7bj

Warm regards,
Jenny

@BoardFsteiner Hello! When there is another airline in the trip, the bags usually must be rechecked at the transit. You can also double check the baggage tag if it states that it will go all the way from MUC to AJR. 

Warm regards,
Jenny

@jonathanpaul999 Hi! 

Yes that seems a little weird, but it might be due to a restriction on the flight. So the best i can recommend is to call our customer service by phone. You can find our number here: https://t.co/O6Jy9vqnvM

//Best regards, Dennis.
